import React from 'react'

const Chapters=(props)=>{
    return(
        <ul>
            {props.Subject.map((subject)=>{
                return(
                    <li>
                        <h2>Select Chapters from {subject}</h2>
                        <form action="/action_page.php">
                            <input type="checkbox" id="ChapterX1" name="ChapterX1" value="Chapter_X1"/>
                            <label for="ChapterX1"> Chapter_1 </label><br/>
                            <input type="checkbox" id="ChapterX2" name="ChapterX2" value="Chapter_X2"/>
                            <label for="ChapterX2"> Chapter_2 </label><br/>
                        </form>
                    </li>
                )
            })}
  
      </ul>
    );
}

export default Chapters;
